import React from 'react'

export function Toolbar({ setFavoritesList }) {
    return (
        <div className="modal-bar">
            <h1 onClick={() => setFavoritesList(false)}>Home page</h1>
            <h1>Library</h1>
            <h1>History</h1>
            <h1 onClick={() => setFavoritesList(true)}>Videos I liked</h1>
        </div>
    )
}
